import React,{useState,useEffect} from 'react';
import './Reply.css';
//import { useParams } from 'react-router';
import Table from 'react-bootstrap/Table';
const Reply = () => {

    const [complain , setTrial]= useState([]);
    function fetchdata () {
        fetch('http://localhost:8080/api/auth/complaints').then((data)=>{
            return data.json();
        })
        .then((data)=>{
            console.log(data)
                setTrial(data);
        })
    }
    useEffect(()=>{
            fetchdata();
    },[]) 

    return (
        <>
            <div className="introReply">
                <p className="firstLineReply">
                    Redressal to your Grievance from Faculty
                </p>
                <Table striped bordered>
                    <thead style={{backgroundColor:'#39b9d2'}}>
                        <tr>
                            <th>Grievance ID</th>
                            <th>Grievance Subject</th>
                            <th>Grievance Redressal</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{complain?._id}</td>
                            <td>{complain?.grievancesub}</td>
                            <td>{complain?.grievancedesc}</td>
                        </tr>
                        <tr>
                            <td>-</td>
                            <td>-</td>
                            <td>-</td>
                        </tr>
                    </tbody>
                </Table>
            </div>
        </>
    )
}

export default Reply
